const AboutMe = () => {
  return (
    <div className="aboutme">
      <h3 className="aboutme__title">Студент</h3>
      <div className="card">
        <h2 className="card__name">Миша</h2>
        <p className="card__about>">Фронтенд-разработчик, 32 года</p>
        <p className="card_description">
          Я родился в Твери, живу на о.Тенерифе, закончил факультет экономики. У
          меня есть жена и дочь. Я люблю слушать музыку, а ещё увлекаюсь
          треккингом. Год назад решил пройти обучение по веб-разработке. С 2010
          года работал коммерческих банках РФ.
        </p>
      </div>
    </div>
  );
};

export default AboutMe;
